package com.digitalremains;

import com.digitalremains.deceasedmanagement.model.FileUpload;
import com.digitalremains.deceasedmanagement.service.CertificateContentParser;
import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;

import java.util.Arrays;
import java.util.stream.Collectors;

@SpringBootApplication
public class SbServerApplication {

    public static void main(String[] args) {
        final CertificateContentParser parser = SpringApplication.run(SbServerApplication.class, args)
                        .getBean(CertificateContentParser.class);
        parser.parse(new FileUpload(1L,
                "Screenshot from 2025-02-01 15-05-58.png",
                Arrays.asList("","","","","","","","","","","","","", "")
                        .stream().collect(Collectors.joining())

        ));
        SpringApplication.run(SbServerApplication.class, args);
    }

}
